// Reducer check Tokens

var initialState =  {tokens_list: [ 'token1', 'token2', 'token2']};

// Reducer - в зависимости от типа Action добавляет значение в State
export default function check_tokens_reducer (state = initialState, action) {
if (action.type === 'SET_TOKENS_LIST'){
  return {
    ...state, 
    tracks: [...state, action.payload]
  }
}
return state;
}
